CREATE PROCEDURE [dbo].[SP_DeleteCompany]
	-- Add the parameters for the stored procedure here
	@CompanyID bigint,
	@ModifiedBy bigint,
	@ModifiedDate datetime
AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT OFF;
	BEGIN TRY 
		UPDATE PARTNER_FAMILY  SET IS_DELETED = 1,FK_MODIFIED_BY = @ModifiedBy, MODIFIED_DATE = @ModifiedDate WHERE FK_PARTNERID IN (SELECT PK_PARTNERID FROM PARTNER WHERE FK_COMPANYID = @CompanyID);
		UPDATE PARTNER_MISC SET IS_DELETED = 1, FK_MODIFIED_BY = @ModifiedBy, MODIFIED_DATE = @ModifiedDate WHERE FK_COMPANYID = @CompanyID;
		UPDATE PARTNER SET IS_DELETED = 1,FK_MODIFIED_BY = @ModifiedBy, MODIFIED_DATE = @ModifiedDate WHERE FK_COMPANYID = @CompanyID;
		UPDATE EMPLOYEE SET IS_DELETED = 1,FK_MODIFIED_BY = @ModifiedBy, MODIFIED_DATE = @ModifiedDate WHERE FK_COMPANYID = @CompanyID;
		UPDATE COMPANY SET IS_DELETED = 1,FK_MODIFIED_BY = @ModifiedBy, MODIFIED_DATE = @ModifiedDate WHERE PK_COMPANYID = @CompanyID;
			RETURN 1;
	END TRY
	BEGIN CATCH
			INSERT INTO [dbo].[DB_Errors] VALUES (SUSER_SNAME(),ERROR_NUMBER(),ERROR_STATE(),ERROR_SEVERITY(),ERROR_LINE(),ERROR_PROCEDURE(),ERROR_MESSAGE(),GETDATE());
			RETURN 0;
	END CATCH
END
